    import numpy as np

    # Edge Recombination Crossover (ERX) optimized for path representation
    def edge_recombination(parent1, parent2):
        edge_map = {}
        for parent in (parent1, parent2):
            for i, node in enumerate(parent):
                neighbors = set([parent[(i - 1) % N_P], parent[(i + 1) % N_P]])
                if node in edge_map:
                    edge_map[node].update(neighbors)
                else:
                    edge_map[node] = neighbors

        current = np.random.choice(parent1)  # Start with a random node from parent1
        child = [current]
        for _ in range(1, N_P):
            # Remove current node from edge_map
            for edges in edge_map.values():
                edges.discard(current)

            if edge_map[current]:
                # Choose next node with fewest edges
                next_node = min(edge_map[current], key=lambda x: len(edge_map[x]))
            else:
                # Random choice from unvisited nodes
                unvisited = [node for node in range(N_P) if node not in child]
                next_node = np.random.choice(unvisited)

            child.append(next_node)
            current = next_node    # Update current node to next node

        return np.array(child, dtype=np.int32)

    # Minimal disturbance mutation
    def mutate(path):
        path = np.copy(path)
        for _ in range(2):  # Perform two swaps
            i, j = np.random.choice(N_P, 2, replace=False)
            path[i], path[j] = path[j], path[i]
        return path

    def tournament_selection(ranking, k=3):
        selected_index = np.random.choice(len(ranking), k, replace=False)
        return selected_index[np.argmin(ranking[selected_index])]

    individuals = pops['individuals']
    rankings = pops['rankings']

