    import numpy as np

    # Sub-function to calculate the combined costs from D_lst for a given path
    def calculate_path_cost(path):
        total_cost = 0
        for o in range(D_lst.shape[0]):
            for i in range(N_P - 1):
                total_cost += D_lst[o, path[i], path[i+1]]
            total_cost += D_lst[o, path[-1], path[0]]  # last to first city
        return total_cost

    # Sub-function for pairwise tournament selection
    def tournament_selection():
        idx1, idx2 = np.random.choice(range(POP_SIZE), 2, replace=False)
        if pops['rankings'][idx1] <= pops['rankings'][idx2]:
            return pops['individuals'][idx1].copy()
        else:
            return pops['individuals'][idx2].copy()

    # Sub-function for order 1 crossover
    def order_crossover(parent1, parent2):
        child = -np.ones(N_P, dtype=np.int32)
        start, end = sorted(np.random.choice(range(N_P), 2, replace=False))
        child[start:end+1] = parent1[start:end+1]
        filled = set(parent1[start:end+1])
        fill_pos = (end + 1) % N_P
        for city in parent2:
            if city not in filled:
                child[fill_pos] = city
                filled.add(city)
                fill_pos = (fill_pos + 1) % N_P
        return child

    # Sub-function for swap mutation
    def swap_mutation(individual, mutation_rate=0.1):
        if np.random.rand() < mutation_rate:
            swap_indices = np.random.choice(range(N_P), 2, replace=False)
            individual[swap_indices[0]], individual[swap_indices[1]] = individual[swap_indices[1]], individual[swap_indices[0]]
        return individual

    # Generating new population
    new_pops = np.empty((POP_SIZE, N_P), dtype=np.int32)
